import styled from "styled-components";
import { ReactComponent as cancel } from "../../../assets/icon/cancel.svg";

export const Container = styled.div`
  min-height: 50px;
  min-width: 50px;
  background: #edeff3;
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
  cursor: pointer;
`;
export const IconCancel = styled(cancel)`
  width: 40px;
  height: 40px;
  padding: 12px;
  margin: 5px;
  background: #ffffff;
  box-shadow: 0px 2px 2px rgba(174, 176, 181, 0.314986);
  border-radius: 20px;
`;
